import Link from 'next/link'

function EdbContent({ content }) {
    return (
        <ul>
            {content.map(post => (
                <li>{post.title}</li>
            ))}
        </ul>
    )
}

export async function getStaticProps() {
    const res = await fetch('http://uxteam:neo2020@redesign.docksal/jsonapi/node/tutorials_?page[limit]=10&filter[status][value]=1')
    const posts = await res.json()

    return {
        props: {
            posts,
        },
    }
}

export default EdbContent

